import { btnBackgroundColor } from '../../uiConfig';

const { Meta } = Card;

export default function Profile() {
  return (
    <div style={{height: '100vh'}}>

        <Row>
            <Col xs={{span: '24'}} md={{span: '24'}}>
        {/* <Card title={localStorage.getItem('bitsjoy_name')} ></Card> */}

     <div>
        <h2>    {localStorage.getItem('bitsjoy_pp_image')}</h2>
     </div>
  </Col>
  <Col xs={{span: '24'}} md={{span: '24'}} align="left">
    <Button style={{padding: '0px', color: btnBackgroundColor}} onClick={()=>{
                    localStorage.clear();
                    window.location.reload();
                }} type="link"><b>Log out</b></Button>
</Col>
        </Row>
    </div>
  )
}
